import React, { Component } from "react";
import { Navbar } from "react-bootstrap";
import UserConsumer from "../context";
class BottomAdd extends Component {
  render() {
    return (
      <UserConsumer>
        {(value) => {
          return <Navbar className="fixed-bottom">



          </Navbar>;
        }}
      </UserConsumer>
    );
  }
}
export default BottomAdd;
